import React from "react";
import ViewBtn from "../ViewBtn";
import SaveBtn from "../SaveBtn";



function List(props) {
  return (
    <ul className="list-group">
        <li className="list-group-item"
        //  key={props.books.items.id}
        >
          <img alt={props.title} className="img-fluid" src={props.imageLinks.smallThumbnail} />
          <a href={props.previewLink}>Preview Link</a>
          <ViewBtn/><SaveBtn/>

        </li>
    </ul>
  );
}

export default List;
